import React from 'react';
import PropTypes from 'prop-types';
import { withStyles } from '@material-ui/core/styles';
import Button from '@material-ui/core/Button';
import styles from './scenario-choice.style';

const ScenarioChoice = (props) => {
    const { classes } = props;
    return (
        <div className={"mt-15 " + classes.root}>
            {props.choiceList.map((item, index) => {
                return (
                <Button  key={index} variant="outlined" color="primary" className={classes.choiceBtn} onClick={() => props.onChoiceClick(item)}>
                    {item.displayText}
                </Button>
                );

            })}
        </div>
    );
};

ScenarioChoice.propTypes = {
    classes: PropTypes.object.isRequired,
};

export default withStyles(styles)(ScenarioChoice);
